import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image';
import Row from 'react-bootstrap/Row';
import Card from 'react-bootstrap/Card';

function Character() {
  return (
    <Container style={{margin:'0px'}}>
      <Row>
      <Col xs={1} md={2}>
          <Image style={{width:'200px', height:'200px'}} src="https://th.bing.com/th/id/OIP.dy1K8v9RPpQOLR_N15e5QgHaFj?pid=ImgDet&rs=1" roundedCircle />
          <Card.Title style={{position:'center'}}>Gato</Card.Title>
        </Col>
        <Col xs={1} md={2}>
          <Image style={{width:'200px', height:'200px'}} src="https://th.bing.com/th/id/OIP.dy1K8v9RPpQOLR_N15e5QgHaFj?pid=ImgDet&rs=1" roundedCircle />
        </Col>
        <Col xs={1} md={2}>
          <Image style={{width:'200px', height:'200px'}} src="https://th.bing.com/th/id/OIP.dy1K8v9RPpQOLR_N15e5QgHaFj?pid=ImgDet&rs=1" roundedCircle />
        </Col>
        <Col xs={1} md={2}>
          <Image style={{width:'200px', height:'200px'}} src="https://th.bing.com/th/id/OIP.dy1K8v9RPpQOLR_N15e5QgHaFj?pid=ImgDet&rs=1" roundedCircle />
        </Col>
        <Col xs={1} md={2}>
          <Image style={{width:'200px', height:'200px'}} src="https://th.bing.com/th/id/OIP.dy1K8v9RPpQOLR_N15e5QgHaFj?pid=ImgDet&rs=1" roundedCircle />
        </Col>
        <Col xs={1} md={2}>
          <Image style={{width:'200px', height:'200px'}} src="https://th.bing.com/th/id/OIP.dy1K8v9RPpQOLR_N15e5QgHaFj?pid=ImgDet&rs=1" roundedCircle />
        </Col>
      </Row>
    </Container>
  );
}

export default Character;
